import { ReactComponent as AirplaneTilt } from "./airplane-tilt.svg";

function BudgetMenager() {
  return (
    <div className="budget-container">
      <div className="budget-item">
        <AirplaneTilt className="test" />
      </div>
    </div>
  );
}
export default BudgetMenager;
